import React from "react";
import QuotesGrid from "../../QuotesGrid/QuotesGrid";
import Card from "../../../Card/Card";
export default function UsersQuotes() {
	return (
		<div>
			<Card>
				username="Romina" quote="“I love you, not only for what you are, but for
				what I am when I am with you.”" tag="Love" quoteTittle="Love for all"
			</Card>
		</div>
	);
}
